import React from "react";
import "./App.css";
import { Map, Marker } from "pigeon-maps";





function App() {


  return (
    <div className='App'>
      <h1>eatAll</h1>
      <section><Map height={400} defaultCenter={[40.712776, -74.005974]} defaultZoom={15}>
        <Marker width={50} anchor={[40.712776, -74.005974]} />
      </Map></section>
      <footer><input type="radio" id="html" name="fav_language" value="HTML">
        <label for="html">HTML</label></input></footer>
    </div>

  );
}

export default App;
